
public class FiveTimes5StarsDiffRowDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		//3.print 5 stars,5 times in different rows
				for(int i=1;i<=5;i++)
				{
					for(int j=1;j<=5;j++)
					{
						System.out.println("*");
					}
					System.out.println();
				}
				System.out.println();
				
				
	}

}
